INSERT INTO `projects` (`id`, `project_title`, `project_ref`, `project_facade_number`, `project_cadastral_income`, `project_charges`, `project_creation_date`, `project_start_build_date`, `project_end_build_date`, `project_start_diffusion_date`, `project_short_description`, `project_long_description`, `project_address`, `project_city`, `project_pc`, `project_state`, `project_country`, `project_active_online`, `project_actual_phase`, `project_lat`, `project_long`, `project_status`, `project_environment_type`, `project_terrain_size`, `project_parking_in_number`, `project_parking_out_number`, `project_floor_number`, `project_handicapped_access`, `project_lift`, `project_concierge`, `project_peb`, `project_heating_type`, `project_energy_consumption`, `project_CO2_emission`, `project_air_conditioning`, `project_heat_pump`, `project_double_glazing`, `project_PV`, `project_distance_schools`, `project_distance_shops`, `project_distance_transports`, `createdAt`, `updatedAt`, `ProjecttypeId`) VALUES
(1, 'Green Park ', NULL, NULL, NULL, NULL, NULL, '2006-02-15 00:00:00', '2007-06-30 00:00:00', NULL, NULL, 'Résidence " GREEN PARK " , composée de 16 appartements haut de gamme,plein centre de la commune , architecture contemporaine.', 'Rue des Digues 9a & 9b', 'Ecaussines', '7190', 'Hainaut', NULL, 0, 34, '50.56681600897844', '4.16819238974914', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-07-22 19:12:19', '2019-07-22 19:12:19', 1),
(13, 'Résidence MARIE ', NULL, NULL, NULL, NULL, NULL, '2009-01-15 00:00:00', '2009-11-28 00:00:00', NULL, NULL, 'La Résidence "Marie" est une résidence composée de 8 appartements.d\'une architecture riche et contemporiane, elle se positionne comme un exemple d\'intégration, les lignes apurées lui donne tout l\'élégance et la finesse d\'une construction en phase avec son temps.', 'Rue A.Mary 6d', 'Ecaussinnes', '7190', 'Hainaut', NULL, 0, 34, '50.56230878838037', '4.14962454536894', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-07-22 19:12:19', '2019-07-22 19:12:19', 1),
(14, 'Les jardins d\'Ecaussinnes', NULL, NULL, NULL, NULL, NULL, '2010-08-09 00:00:00', '2011-12-31 00:00:00', NULL, NULL, 'Situé à quelques pas du centre et des jardins du Château fort, nous vous proposons une résidence à appartements contemporains bénéficiant de tout le confort & le standing pour nos clients les plus exigeants, agrémentés de grandes terrasses profitant d\'une orientation sud, sud est, finitions personnalisables,très lumineux ou il fera bon vivre. Une attention toute particulière à été apportée à l\'isolation acoustique & thermique, chaudière au gaz individuelle à haut rendement, construction en basse énergie; faible consommation énergétique, panneaux photovoltaïques, les rez de chaussées profitent d\'un jardin privatif, COUP DE CŒUR ASSURE, contact au 0475/436.416, site www.imoges.be', 'Rue du Daim ', 'Ecaussinnes', '7190', 'Hainaut ', NULL, 0, 34, '50.56668741306997', '4.17020180118866', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-07-22 19:12:19', '2019-07-22 19:12:19', 1),
(22, 'Les Maisons de Marie', NULL, NULL, NULL, NULL, NULL, '2010-10-01 00:00:00', '2011-08-31 00:00:00', NULL, NULL, '"Les maisons de Marie"   MAISON BASSE ENERGIE.\nProjet composé de 5 maisons unifamiliales, de trois chambres avec garage & jardin à faible consomation énergétique grâce à l\'utilisation d\'une isolation renforcée, alliant une architecture contemporaine et créative. A proximité immédiate des noeuds autoroutiers (Bruxelles, Mons, Charleroi, Nivelles ,Tournai, Briane le comte...) des magasins et des moyens de transport tout en profitant du calme du village d\'Ecaussinnes. Prix: de 237.000 €(htva). Construction sous loi Breyne,  Livraison fin aôut 2011.', 'Rue A.Mary', 'Ecaussinnes', '7190', 'Hainnaut', NULL, 0, 34, '50.55420830896313', '4.14675561824648', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-07-22 19:12:19', '2019-07-22 19:12:19', 1),
(23, '5 appartements rue J.JAURES', NULL, NULL, NULL, NULL, NULL, '2008-08-04 00:00:00', '2009-05-29 00:00:00', NULL, NULL, 'Résidence de 5 appartements , dans un style d\'architecture traditionnel ,avec l\'utilisation de pierre bleue en façade avec des sous bassement à l\'ancienne sur une note comptenporaine.', 'Rue J.Jaures 33', 'Ecaussinnes', '7190', 'Hainaut', NULL, 0, 34, '50.56822993106202', '4.16449563862305', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-07-22 19:12:19', '2019-07-22 19:12:19', 1),
(25, 'ALEXANDRE', NULL, NULL, NULL, NULL, NULL, '2012-11-01 00:00:00', '2013-12-01 00:00:00', NULL, NULL, 'Petite résidence composée de 5 appartements de 2 chambres, situation calme, proche de la gare, idéalement situé proche de Bruxelles ( 40 km) , Nivelles , Mons ,Charleroi.\nAppartement plein de charme dans une résidence à l\'architecture audacieuse et contemporaine, séjour très lumineux ,terrasse de 9 m² avec une belle orientation sud ouest . Construction basse énergie, chaudière au gaz haut rendement ,un AVANTAGE sur vos factures énergétiques , isolation acoustique performante, tout confort ,cuisine super équipée , parking en car port et cave en sous sol. COUP DE COEUR ASSURE . CONTACT : 0487/750.306.\nDévourez Ecaussinnes', 'RUE DU ROI ALBERT', 'ECAUSSINNES', '7190', 'HAINAUT', NULL, 0, 34, '50.56349620000000', '4.14908309999998', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-07-22 19:12:19', '2019-07-22 19:12:19', 1),
(26, 'O.Strebelle ', NULL, NULL, NULL, NULL, NULL, '2014-03-01 00:00:00', '2015-09-21 00:00:00', NULL, NULL, 'La résidence « O. Strebelle » à l\'architecture riche et contemporaine . Idéalement située, à deux pas des commerces, de la gare, et des voies de communications. Le projet « O. Strebelle » est avant tout une construction à très faible consommation énergétique , grâce à l\'utilisation de châssis haut de gamme, d\'isolation renforcée ,de chaudière individuelle à condensation ,d\'un système de renouvellement de l\'air par un système double flux, mais également d’une isolation acoustique performante .NOTRE PROJET REPRESENTE UN BEL INVESTISSEMENT SUR L’AVENIR . CONTACT AU 0487/750.306.', 'Rue V.Cuvelier ', 'Ecaussinnes', '7190', 'hainaut', NULL, 0, 34, '50.56518725522914', '4.15010690689087', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-07-22 19:12:19', '2019-07-22 19:12:19', 1),
(27, 'INES', NULL, NULL, NULL, NULL, NULL, '2014-11-30 00:00:00', '2016-02-29 00:00:00', NULL, NULL, 'Votre Appartement en plein cœur de Soignies\nLa résidence « INES  » Située à quelques pas de la Collégiale et de son centre historique repose sur une  architecture riche et contemporaine . Des appartements lumineux avec  des finitions de qualité, le tout dans un environnement calme à proximité de commerces et des transports en commun. La résidence« INES » est une construction à très faible consommation énergétique , isolation renforcée , chaudière individuelle à condensation ,d\'un système de renouvellement de l\'air par un système double flux, mais également d’une isolation acoustique très performante .NOTRE PROJET REPRESENTE UN BEL INVESTISSEMENT SUR L’AVENIR . CONTACT AU 0487/750.306.', 'Rue du Rempart du Vieux Cimetière ', 'Soignies', '7060', 'Hainaut', NULL, 0, 34, '50.58138920000000', '4.07129110000005', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-07-22 19:12:19', '2019-07-22 19:12:19', 1),
(28, 'Les Demoisselles ', NULL, NULL, NULL, NULL, NULL, '2016-12-01 00:00:00', '2018-05-01 00:00:00', NULL, NULL, 'La résidence « Les Demoiselles  » bénéficie d’une situation exceptionnelle, au calme tout en profitant des avantages de la proximité des commerces, écoles, et transports en commun ainsi que des axes routiers. Les alentours permettent d’agréables promenades. Située à 1.5 km du bois de la Houssière,  la résidence « Les Demoiselles » séduira nos acquéreurs les plus exigeants. Agrémentés de grandes terrasses, finitions personnalisables, séjour très lumineux ou il fera bon vivre. Une attention toute particulière a été apportée à l\'isolation acoustique & thermique, chaudière au gaz individuelle à haut rendement, construction en basse énergie; faible consommation énergétique, panneaux photovoltaïques, les rez de chaussées profitent d\'un jardin privatif, COUP DE CŒUR ASSURE, contact au 0487/750.306, VISITE NOTRE PAGE FACEBOOK / https://www.facebook.com/imoges.construction/', 'Rue de L\'Entente', 'Braine Le Comte ', '7090', 'hainaut', NULL, 0, 34, '50.59770381257454', '4.13334846496582', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-07-22 19:12:19', '2019-07-22 19:12:19', 1),
(29, 'ALEXANDRE II', NULL, NULL, NULL, NULL, NULL, '2017-03-01 00:00:00', '2018-06-01 00:00:00', NULL, NULL, 'La résidence " ALEXANDRE II" bénéficie d’une très belle situation, au calme en bordure d’une zone domaniale tout en profitant des avantages de la proximité du centre-ville ainsi que des axes routiers.Le projet a été étudié dans un souci global de développement durable et d\'économie d\'énergie: pompe à chaleur , isolation importante des parois de déperdition et chauffage par le sol (catégorie basse énergie PEB A+).Nous apportons une attention toute particulière à l’isolation acoustique de chacune de nos réalisations. L’aménagement intérieur de nos appartements est réalisé en fonction des demandes formulées par nos clients.CONTACT 0487/750.306. / info@imoges.be\n \n', 'RUE LAURENT-GODEFROID PERNIAUX', 'ECAUSSINNES', '7190', 'HAINAUT', NULL, 0, 1, '50.81423320000000', '4.30373330000000', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-07-22 19:12:19', '2019-07-22 19:12:19', 1),
(30, 'LES MAISONS DE MARIE II', NULL, NULL, NULL, NULL, NULL, '2018-08-01 00:00:00', '2019-10-01 00:00:00', NULL, NULL, 'Les maisons Marie c\'est : de beaux espaces ,une grande luminosité dans l\'ensemble des pièces de vie ,un aménagement fonctionnel, des performances thermiques en label A, belle terrasse ensoleillée (sud-ouest), un cahier des charges rigoureux ,de 3 à 5 chambres, Parking en carport- Un environnement agréable en bordure d’une zone protégée - Proche du centre et des axes routiers (10’ à pied de la gare)- Finitions au choix de l’acquéreur- Accompagnement et suivi de nos clients. Les maisons de Marie vont vous séduire.', 'RUE A.MARY ', 'ECAUSSINNES', '7190', 'HAINAUT', NULL, 0, 1, '50.81423320000000', '4.30373330000000', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-07-22 19:12:19', '2019-07-22 19:12:19', 1),
(31, 'MORGANE', NULL, NULL, NULL, NULL, NULL, '2019-03-01 00:00:00', '2019-09-01 00:00:00', NULL, NULL, 'La résidence « Morgane  » bénéficie d’une situation centrale entre Ecaussinnes et Marche-les-Ecaussinnes, situé à 1.5 km de la gare, des commerces, écoles. Proche des transports en commun .\nLes alentours permettent d’agréables promenades. Située à 1.5 km du bois de la Houssière,la résidence « Morgane » séduira nos acquéreurs les plus exigeants.\n \nLa Résidence « Morgane  » c’est une construction en « BASSE ENERGIE », grâce à l’utilisation d’une isolation renforcée (murs, toitures, vitrages, châssis…), de chaudières individuelles au gaz à haut rendement avec une régulation électronique couplée à une sonde extérieure, ainsi que l’utilisation d’un système double flux.', 'RUE DE L\'AVEDELLE ', 'ECAUSSINNES', '7190', 'HAINAUT', NULL, 0, 1, '50.81423320000000', '4.30373330000000', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-07-22 19:12:19', '2019-07-22 19:12:19', 1),
(32, 'INES II', NULL, NULL, NULL, NULL, NULL, '2019-08-15 00:00:00', '2020-12-15 00:00:00', NULL, NULL, 'La résidence « INES II » et située à un jet de la collégiale et de son centre historique, une situation hors du commun, proche des commerces, d’écoles, des transports en commun ainsi que des axes routiers. Les alentours permettent d’agréables promenades.\n \nLe projet a été étudié dans un souci global de développement durable et d\'économie d\'énergie: chaudière au gaz haut rendement , isolation importante des parois de déperdition et chauffage par le sol ainsi que l’utilisation d’un système double flux. (catégorie basse énergie PEB A).\n \nNous apportons une attention toute particulière à l’isolation acoustique de chacune de nos réalisations.\n \nL’aménagement intérieur de nos appartements est réalisé en fonction des demandes formulées par nos clients , nous possédons l’avantage d’une gestion personnalisée pour chacun de nos acquéreurs.', 'Rue Steenkerque ', 'Soignies', '7060', 'Hainaut ', NULL, 0, 1, '50.81423320000000', '4.30373330000000', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-07-22 19:12:19', '2019-07-22 19:12:19', 1);
